/**
 * Created by Basil on 6/1/20.
 */
import React, {Component} from 'react';
import '../../App.css';
class MenuPermissionComponent extends Component {
    constructor(props) {
        super(props);

    }
    render() {
        return (
            <div>
                <h1>Menu Permission Page loaded successfully</h1>
                <div className="menu-permission">
                   <div>Main Menu:<input type="checkBox" name="menuPermission"/></div>
                </div>
            </div>
        )
    }
}
export default MenuPermissionComponent;
